import React from "react"
import { observer } from "mobx-react";
import { StoreTodo } from "../stores/NoteStore"

const ToDoItem  = observer(() => {

        return(
            StoreTodo.listOfItems.map( item => {
                {item.title}
            })
        )
})

export default ToDoItem;
